import React from "react";

type Props = {
	title: string;
	content: string;
	children: ReactElement;
};

export function Section(props: Props) {
	const { title, content } = props;
	return (
		<div className="section">
			<h1 className="title">{title}</h1>
			<div className="subsection">{content}</div>
		</div>
	);
}
